CREATE TABLE `utilizacion_suministro` (
  `NroIdentificacion` int NOT NULL,
  `personalmedico_Empleados_Personas_DNI` int unsigned NOT NULL,
  `suministros_CodigoSuministro` varchar(6) NOT NULL,
